import { View, Text, StyleSheet} from 'react-native';
import {
    styles
} from './styles';

class Home extends Component {
  constructor(props) {
    super(props);

  }
  render() {
    return (
        // <View style={styles.container}>
        //   <Text style={styles.text}> Stonks </Text>
        //   // <StatusBar style="auto" />
