        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
          <Text>Stonks</Text>
          <Button
            title="Go to Login"
            onPress={() => navigation.navigate('LoginPage')}
          />
        </View>

      );
  }
}

export default Home;
